import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 32, height: 32, viewBox: "0 0 32 32", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M10 21.81V29a1 1 0 001.51.86l4.49-2.7 4.49 2.7A1 1 0 0022 29v-7.19a11.45 11.45 0 01-12 0zm12-1.8a9.96 9.96 0 01-12.36-.3A10 10 0 1122 20z", fill: primaryFill }));
};
const Ribbon32Filled = wrapIcon(rawSvg({}), 'Ribbon32Filled');
export default Ribbon32Filled;
